import { useEffect } from "react";
const Posts = (props) => {

    useEffect(()=>{
        getPosts()
    }, [])
    const getPosts=()=>{

        return fetch('https://jsonplaceholder.typicode.com/posts')
        .then((res) => res.json())
        .then((res) => {
        post : res }
        )
    }
    return(
        <div>
            <h1>Post List</h1>
            {
                post.map(post => (
                    <div key={post.id}>
                        <h5><b>Title : </b> {post.title}</h5>
                        <p>
                            {post.body}
                        </p>
                    </div>
                ))
            }
        </div>   
    )
}
export default Posts;
